<script>
	import { ViewBox, XHeader, Swiper, Tabbar, TabbarItem,  Drawer, Loading,Toast,Badge,Group,Cell, Grid, GridItem,XInput,XButton} from 'vux'
	import api from '../../components/other/api-url'
	import globalPM from '../../components/other/global-parameter'
	import axios from 'axios'
	import Cookies from 'js-cookie'
	import router from '../../router/index'
	import AvatarCropper from 'vue-avatar-cropper'
	import MD5 from 'md5'
	var CryptoJS = require("crypto-js")

	export default {
		components: { ViewBox, XHeader, Swiper, Tabbar, TabbarItem, Drawer, Loading,Toast,Badge ,Group,Cell,Grid, GridItem,AvatarCropper,XInput,XButton},
		data() {
			return {
				errorStatus: false,
				errorMsg: '',
				loading: false,
				phone:'',
				disabled:true,
				passworda:'',
			}
		},
		methods: {
			back(){
				router.push('/my')
			},
			ddd(){
				$(".jianpan").hide('blind',{direction:'down'},100)
			},
			xianshi(){
				setTimeout(function  () {
					$(".jianpan").show('blind',{direction:'down'},100)
				},100)
			},
	      setting(){//取消登录
	      	router.push("/my")
	      },
	      register(){//注册
	      	router.push('/register')
	      },
	      forgetpassword(){//忘记密码
	      	router.push('/forgotPassword')
	      },
	      login(){
	      	const _this = this;
	      	_this.loading = true;
	        axios.post(api + '/user/login?loginName=' + this.phone + '&passwd=' + MD5(this.passworda).toUpperCase() + '&valid=0' + globalPM)
	          .then(function (response) {
	            console.log(response)
	            if (response.data.code === 0) {
	              localStorage.setItem("token",response.data.data.token)
	              localStorage.setItem("uid",response.data.data.uid)
	              localStorage.setItem("userHeader",response.data.data.photo)
	              localStorage.setItem("nickName",response.data.data.nickName)
	              localStorage.setItem("phone",response.data.data.phone)
	              localStorage.setItem("keykey",MD5(localStorage.getItem('uid')).substring(8,24))
	              localStorage.setItem("iv",'2a44fdd9ee93bdf9')
	              _this.loading = false;
	              _this.errorMsg = '登录成功'
	              _this.errorStatus = true
	              setTimeout(function  () {
						router.push('/')
					},500)
	            } else {
	              _this.loading = false
	              _this.errorMsg = response.data.msg
	              _this.errorStatus = true
	            }
	          })
	          .catch(function (error) {
	            console.log(error)
	          })
	      }
		},
		created() {
			localStorage.setItem('xxx',1)
		},
		updated(){
			const _this = this
			if (_this.phone.length==11&&_this.passworda.length>5) {
				_this.disabled = false;
			}else{
				_this.disabled=true;
			}
			if (_this.phone.length == 12) {
				let e = _this.phone
				_this.phone = e.substr(0,(e.length-1))
			}
		},
	}
</script>

